import sys
import ast

def main():
    data = sys.stdin.read().strip()
    if not data:
        return
    try:
        names = ast.literal_eval(data)
        if isinstance(names, str):
            names = [names]
    except Exception:
        # if not a Python literal, treat whole input as single name (strip newlines)
        names = [data.strip()]
    out = ["false"] * len(names)
    # print as Python list literal like in the example
    print(str(out))

if __name__ == "__main__":
    main()
